/* Style générique d'affichage des noms d'éléments */
table::after,
th::after,
caption::after,
ul::after,
ol::after,
li::after,
blockquote::after,
a[href]::after,
h1::after,
h2::after,
h3::after,
h4::after,
h5::after,
h6::after,
p::after,
img::after {
    margin: 5px;
    padding: 2px;
    background-color: #ffe94a;
    border: 2px solid #000000;
    color: #000000;
    font-family: "Courier", "Courier New", monospace;
    font-weight: bold;
}

h1 {
    outline: 4px dashed #c40000;
}
h1::after {
    content: "h1";
}

h2 {
    outline: 4px dashed #603e00;
}
h2::after {
    content: "h2";
}

h3 {
    outline: 4px dashed #006017;
}
h3::after {
    content: "h3";
}

h4 {
    outline: 4px dashed #004773;
}
h4::after {
    content: "h4";
}

h5 {
    outline: 4px dashed #3f0086;
}
h5::after {
    content: "h5";
}

h6 {
    outline: 4px dashed #5d6000;
}
h6::after {
    content: "h6";
}

ul {
    border: 4px dotted #0a3d6f;
}
ul::after {
    content: "ul";
}
ol {
    border: 4px dotted #0a3d6f;
}
ol::after {
    content: "ol";
}

li {
    border: 2px dashed #100295;
}
li::after {
    content: "li";
}

table {
     outline: 4px dotted #c40000;
}

table::after {
    content: "table";
}

th {
    outline: 4px dotted #603e00;
}
th::after {
    content: "th";
}

caption {
    outline: 4px dotted #006017;
}
caption::after {
    content: "caption";
}
